import React, { useState, useEffect } from 'react'

function Table(props) {
    const { bands } = props;
    return (
      <table>
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
            <th>Year</th>
          </tr>
        </thead>
        <tbody>
          {band.map(band => (
            <tr key={band.id}>
              <td>{band.name}</td>
              <td>{band.price}</td>
              <td>{band.stock}</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  }

  export default Table
